import React from 'react';
import { Container } from 'react-bootstrap';
import HeaderNavigation from './HeaderNavigation';
import HeroSection from './HeroSection';
import InfoSection from './InfoSection';

const Layout = () => {
// Example of a Dynamic Structure
const structuredNavLinks = [
  { label: "Как Работи", href: "#" },
  { label: "Услуги", href: "#" },
  {
    label: "За Нас",
    subLinks: [
      { label: "Екип", href: "#" },
      { label: "История", href: "#" },
      { label: "Контакти", href: "#" },
    ],
  },
  { label: "Запиши Се", href: "#" },
];
  return (
    <Container fluid className="d-flex flex-column min-vh-100">
        <HeaderNavigation
    brandName="CHECKERS"
    logoUrl="https://dashboard.codeparrot.ai/api/image/Z7O5HTO_YEiK21yL/frame.png"
    navLinks={structuredNavLinks}
  />
      <HeroSection />
      <InfoSection />
    </Container>
  );
};

export default Layout;
